import React, {PureComponent} from 'react';
import {Nav,
        NavItem
            } from './style';

class Download extends PureComponent{
    render(){
        return (
            <Nav>
                <NavItem>1</NavItem>
                <NavItem>2</NavItem>
                <NavItem>3</NavItem>
                <button className="btn" ></button>
            </Nav>
        )
    }
}

export default Download;
